import React, { Component } from 'react';
import History from "../history"
import "./component-css/navbar.css"
import Logo from "../logo.svg"

class NavBar extends Component {


    render() { 
        return (  

            <div className="navbar">
                <div className="navbar-container">
                    <div className="logo"> <div className="logo-content"> <img src={Logo} alt=""/></div></div>
                    <div className="links"> 
                        <ul>
                            <li class="border-animation" onClick={() => History.push(`/`)} > <span ></span>Home </li>
                            <li onClick={() => History.push(`/projects`)} >Projects</li>
                            <li onClick={() => History.push(`/about`)} >About Me</li>
                            <li onClick={() => History.push(`/blog`)} >Blog</li>
                        </ul>
                    </div>
                </div>

            </div >


            );}
}

export default NavBar
;
